import React from 'react';
import './slider.css'
const slider = (props) => {
    console.log(props)
    return ( 
        <div className="slidecontainer">
        <input type="range" min="1" max="100" value={props.slider.range} className="slider" id="myRange" onChange={(event) => props.draggged(event)}/>
      </div>
     );
}

export default slider;
